import React from 'react';
import styled from 'styled-components';
import img from './image5.png';
import Banner from '../Banner';

const HeroCont = styled.div`${(_)=>css`
height: 967px;
width: 573px;
border-radius: 0px;
background: url(${img});
display: inline-flex;
justify-content: flex-end;
`}`;

const BannerComp = styled.div`
    position: relative;
    top: 65%;   
`;

const Hero = ({}) => {
    return <HeroCont>
        <BannerComp><Banner></Banner></BannerComp>
    </HeroCont>
}

export default Hero;
